import Header from './components/Header'
import Form from './components/Form'


import "./App.css"

type User = {
    id: string;
    user: {
        name: string;
        email: string;
        whatsapp: number;
    }
}

export const App: React.FC = () => {
    return (
        <div className="Wrapper">
            <Header></Header>
            <Form mask={"nome"}></Form>
        </div>
    )
}
